,"volumeInfo":{"title":"Expert Python Programming","subtitle":"Master Python by learning the best coding practices and advanced programming concepts, 4th Edition","authors":["Michał Jaworski","Tarek Ziadé"],"publisher":"Packt Publishing Ltd","publishedDate":"2021-05-28","description":"Gain a deep understanding of building, maintaining, packaging, and shipping robust Python applications Key FeaturesDiscover the new features of Python, such as dictionary merge, the zoneinfo module, and structural pattern matchingCreate manageable code to run in various environments with different sets of dependenciesImplement effective Python data structures and algorithms to write, test, and optimize codeBook Description This new edition of Expert Python Programming provides you with a thorough understanding of the process of building and maintaining Python apps. Complete with best practices, useful tools, and standards implemented by professional Python developers, this fourth edition has been extensively updated. Throughout this book, you’ll get acquainted with the latest Python improvements, syntax elements, and interesting tools to boost your development efficiency. The initial few chapters will allow experienced programmers coming from different languages to transition to the Python ecosystem. You will explore common software design patterns and various programming methodologies, such as event-driven programming, concurrency, and metaprogramming. You will also go through complex code examples and try to solve meaningful problems by bridging Python with C and C++, writing extensions that benefit from the strengths of multiple languages. Finally, you will understand the complete lifetime of any application after it goes live, including packaging and testing automation. By the end of this book, you will have gained actionable Python programming insights that will help you effectively solve challenging problems. What you will learnExplore modern ways of setting up repeatable and consistent Python development environmentsEffectively package Python code for community and production useLearn modern syntax elements of Python programming, such as f-strings, enums, and lambda functionsDemystify metaprogramming in Python with metaclassesWrite concurrent code in PythonExtend and integrate Python with code written in C and C++Who this book is for The Python programming book is intended for expert programmers who want to learn Python’s advanced-level concepts and latest features. Anyone who has basic Python skills should be able to follow the content of the book, although it might require some additional effort from less experienced programmers. It should also be a good introduction to Python 3.9 for those who are still a bit behind and continue to use other older versions.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781801076197"},{"type":"ISBN_10","identifier":"1801076197"}],"readingModes":{"text":true,"image":true},"pageCount":631,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"2.4.4.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=2tAwEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=2tAwEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=2tAwEAAAQBAJ&printsec=frontcover&dq=programming&hl=&cd=4&source=gbs_api","infoLink":"https://play.google.com/store/books/details?id=2tAwEAAAQBAJ&source=gbs_api","canonicalVolumeLink":"https://play.google.com/store/books/details?id=2tAwEAAAQBAJ"},"saleInfo":{"country":"EG","saleability":"FOR_SALE","isEbook":true,"listPrice":{"amount":1408.58,"currencyCode":"EGP"},"retailPrice":{"amount":1408.58,"currencyCode":"EGP"},"buyLink":"https://play.google.com/store/books/de