ging; variables; and reference types Shows how to use statement repetition and program loops, understand arrays and collections, and write your own classes Also covers inheritance and polymorphism Beginning Object-Oriented Programming with C# uses the tried-and-true Wrox formula for making this popular programming method easy to learn.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781118416471"},{"type":"ISBN_10","identifier":"1118416473"}],"readingModes":{"text":true,"image":true},"pageCount":626,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":true,"contentVersion":"1.2.3.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=NXoOrjq9XawC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=NXoOrjq9XawC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=NXoOrjq9XawC&printsec=frontcover&dq=programming&hl=&cd=5&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=NXoOrjq9XawC&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Beginning_Object_Oriented_Programming_wi.html?hl=&id=NXoOrjq9XawC"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com.eg/books/download/Beginning_Object_Oriented_Programming_wi-sample-epub.acsm?id=NXoOrjq9XawC&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com.eg/books/download/Beginning_Object_Oriented_Programming_wi-sample-pdf.acsm?id=NXoOrjq9XawC&format=pdf&output=acs4_fulfillment_token&d